import React, { useState, useEffect } from 'react';

function Wishlist() {
    const [places, setPlaces] = useState([]);

    useEffect(() => {
        fetch("http://localhost:5000/places").then(response => 
            response.json().then(data => {
                console.log(data)
                setPlaces(data);
            })
        );
    }, []);



    return (
        <ul> 
            {places.map(place => {
                return (
                    <li key={place.name}>
                        <a href="https://maps.googleapis.com/maps/api/place/details/json?place_id=${place.place_id}&fields=url&key=REACT_APP_GOOGLE_API_KEY">{place.name}</a>
                    </li>
                )
            })}
        </ul>
        )
}

export default Wishlist;
